import React, {useState, useEffect} from 'react';
function Header() {
        const [weatherDegrees,setWeatherDegrees]=useState('');
        const [weatherDescrition,setWeatherDescription]=useState('');
        const [weatherIcon,setWeatherIcon]=useState('');

    useEffect(() => {
        const url = 'http://api.weatherstack.com/current?access_key=6515e85ac5aa99126314670e1eef2f9c&query=Mombasa&units=f';
        const weatherRetrieved = fetch(url, {
            method: 'GET'
        })
        .then(response => response.json())
        .then(data => {
            setWeatherDegrees(data.current.temperature);
            setWeatherDescription(data.current.weather_descriptions);
            setWeatherIcon(data.current.weather_icons);
        })
    },[])
    return(
        <div data-testid="headerTest" className="header">
            <div></div>
            <h1 id="pageTitle">Callouts</h1>
            <div id="weather">
                <h3>Current weather in new Mombasa</h3>
                <sp id="weatherDegrees">{weatherDegrees}</sp>
                <img src={weatherIcon}></img>
            </div>
            
        </div>
    );
}
export default Header;
